function Card(card, onCardClick) {

    function handleClick() {
        onCardClick(card);
    }  

    return (
        <div className="card" key={card.id}>
            <img className="card__image" alt={card.name} src={card.link} onClick={handleClick} />
            <button type="button" className="card__remove-button"></button>
            <div className="card__container">
                <h2 className="card__title">{card.name}</h2>
                <div className="card__like-container">
                    <button type="button" className="card__button"></button>
                    <p className="card__botton-counter">{card.likes.length}</p>
                </div>
            </div>
        </div>
    );
}

export default Card;
